import React, { useReducer } from 'react'




const reducer = (action, type) => {

  switch (action.type) {
    case '':
      
      break;
  
    default: return State
    
  }

}



const App = () => {

  const [State, dispatch] = useReducer(reducer, { email: '', pwd: '' })

  return (
    <div className={`app`}>

      <input
        className='inp_css'
        value={State.email}
        onChange={(e) => dispatch({ type: 'handle_email' })}
        placeholder='Enter Email'
        type='email'
      />

      <input
        className='inp_css'
        value={State.pwd}
        onChange={(e) => dispatch({ type: 'handle_pwd' })}
        placeholder='Enter Password'
        type='password'
      />


    </div>
  )
}

export default App
